import { jsPDF } from "jspdf";
const font =
  "";
const callAddFont = function () {
  this.addFileToVFS("NotoSansSinhala-Regular-normal.ttf", font);
  this.addFont(
    "NotoSansSinhala-Regular-normal.ttf",
    "NotoSansSinhala-Regular",
    "normal"
  );
};
jsPDF.API.events.push(["addFonts", callAddFont]);
